+----------------+
|Game Description|
+----------------+

Hop in your gondola, aim high and rescue the sinking buildings of Venice by restoring their lost treasures. Launch coins, lyres and rings into the matching shapes moving overhead. But beware: blocks and traps could give you a sea of troubles. Stay afloat with smart timing and nifty trick shots. Do you have what it takes to save Venice?

Originally released June 26th, 2007.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows 98, ME, 2000, XP, Vista(32/64bit) and 7(32/64bit). Requires DirectX 7.0 or later. Processor requirements: 700MHz CPU or higher. RAM requirements: 256 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 32 MB of video memory.

